import React from 'react';
import ReturnSignInRegister from './SignIn';
import { auth } from '../../firebase';
import { useNavigate } from 'react-router-dom';
import { gsap, Expo } from 'gsap';

// Export View SignIn
export default function SignInRegister() {

 const navigation = useNavigate();
 const user = auth.currentUser;

 React.useEffect(() => {

  user != null ? window.console.log(true) : navigation('/');
  window.setTimeout(() => {
   gsap.to('.App-loading-blank', .1, { delay: 1.2, x: '-1000%', opacity: 0, ease: Expo.easeIn })
  }, 100);

 }, []);

 return (
  <>
   <div className='App-loading-blank'></div>
   <ReturnSignInRegister />
  </>
 );
};
